pragma solidity >=0.5.0;

import "./SafeMath.sol";

contract PrimaryToken 
{
    using SafeMath for uint256;

    uint256 public StartDate ;
    uint256 public EndDate ;

    address public owner = msg.sender;  // storing address of contract deployer

    modifier onlyOwner()
    {
        require(msg.sender == owner,"Not the owner of contract");
        _;
    }


    struct TokenPriceStructure
    {
        uint256 initialPrice ;
        uint256 delta;
    }

    TokenPriceStructure public tokenPriceStructure ;


    struct ShareStructure
    {
        uint256 ComapnySharePerBucket;
        uint256 MaxBucketNumber; 
    }

    ShareStructure public shareStructure ;


    struct TokenBid
    {
        address bidder ;
        uint nbTokens;
        uint256 MaxPrice;  
        uint256 timeOfBid;
    }  

    TokenBid[] bids ;

    struct TokenOwner
    {
        address owner;
        uint256 numberOftokens;
    }

    TokenOwner[] TOwner ;

    uint256 public AmountRaised;
    uint256 public nbTokenBidded;
    uint256 public SharesAllocated;


    struct SellOrder 
    {
        address Seller ; 
        uint256 SellingTokens ;
        uint256 AskingPrice;
    }

    mapping(address => SellOrder ) public SellOrders ;
    SellOrder[] SOrder;

    constructor() public
    {
        tokenPriceStructure.delta;
        tokenPriceStructure.initialPrice;
        shareStructure.ComapnySharePerBucket;
        shareStructure.MaxBucketNumber;
        StartDate = block.timestamp;
        EndDate;
        AmountRaised;
        nbTokenBidded;
        SharesAllocated;
    }


// If currentTime < EndDate , tradeDirection 0 = Buy && 1 = cancelBid (only the least profitable bid))
// && if currentTime > EndDate , tradeDirection 0=Buy (if stocks available ) && 1 = sell

    function PlaceOrder( uint256 _nbTokens, uint256 _tradeDirection, uint256 _MaxPrice) public payable returns (bool)
    {       
        address beneficiary = msg.sender;
        uint256 CurrentPrice = getTokenPrice();  
        uint256 Time = block.timestamp;
        bool res;

        if( Time <= EndDate)
        {
            if(_tradeDirection==0)

            {
                if(CurrentPrice <= _MaxPrice)
                {
                    res = PlaceBuyOrder (beneficiary,_nbTokens,_MaxPrice,Time);
                    return res ;
                }
                else{return false;}
            }
            //checking whether requesting entity has made any bid or not.
            else if (_tradeDirection == 1) 
            {
                uint256 count = 0;
                for (uint256 i=0 ; i<bids.length ; i++)
                {
                    if(beneficiary == bids[i].bidder)
                    {
                        ++count;
                    }
                }
                if(count < 1 || beneficiary == owner)  // owner cannot cancel bid & if no bid from beneficiary 
                {
                    return false ;
                }
                else{

                    res = PlaceCancelBid(beneficiary); 
                    return res ;

                    }

            }

        }


     else if(Time > EndDate)
        { 
            if(_tradeDirection == 0) //buying tokens from seller
            {

                if( SOrder.length > 0) //sorting of SellOrderList
              {  
                    uint256 l = SOrder.length-1;
                    uint256 j;
                    uint256 i;
                        for( i = 0; i < l; i++) {
                            for( j = i+1; j <= l ;j++) {
                                if(SOrder[i].AskingPrice < SOrder[j].AskingPrice) {
                                    uint256 temp = SOrder[i].AskingPrice;
                                    SOrder[i].AskingPrice = SOrder[j].AskingPrice;
                                    SOrder[j].AskingPrice = temp;

                    }
                        }
                        }
              }
              else
              {
                  return false;

              }

              if(SOrder[((SOrder.length) -1)].AskingPrice < _MaxPrice)
               {     
                uint256 tokens = _nbTokens;
                uint256 Amount;
                uint256 id = SOrder.length - 1;

                while(tokens >= 1)
                    {
                    address buyer = msg.sender;
                    address seller = SOrder[id].Seller;

                            if(_MaxPrice >= (SOrder[id].AskingPrice))  // only allocates those tokens for which _MaxPrice is equal or greater to AskingPrice from seller
                       {
                        if(tokens >= SOrder[id].SellingTokens )
                        {
                                //seller
                                uint256 allocatingTokens = SOrder[id].SellingTokens ;
                                tokens = tokens - SOrder[id].SellingTokens ;
                                delete SOrder[id];
                                --SOrder.length;
                                // amount to be transferred to seller
                                 Amount = allocatingTokens.mul(SOrder[id].AskingPrice);


                                //Transferring token ownership to buyer
                                 TOwner.push(TokenOwner (buyer, tokens));

                        }

                        else if(tokens < SOrder[id].SellingTokens)
                        {
                                SOrder[id].SellingTokens = (SOrder[id].SellingTokens).sub(tokens);
                                Amount = tokens.mul(SOrder[id].AskingPrice) ;
                                //Amount Transfer

                                TokenOwner memory TOwners = TokenOwner (buyer, tokens);
                                TOwner.push(TOwners);


                        }
                    }
                    else {return false;}
                    }
                    return true ;
            }
            else {return false ;}
        }

            if (_tradeDirection==1)  // placing sell order by token owners only
            {   
                uint256 i;
                uint256 OwnerTokens = 0;


                if (beneficiary == owner)
                {
                    return false ;

                }

                for( i = 0 ; i < TOwner.length ; i++)
        {
                    if (TOwner[i].owner == beneficiary)
            {
                        OwnerTokens = TOwner[i].numberOftokens;
            }
                }

                if(OwnerTokens < _nbTokens)
                {
                    return false ;
                }
                else
                {
                    TOwner[i].numberOftokens = OwnerTokens.sub(_nbTokens);
                    res = PlaceSellOrder(beneficiary,_nbTokens,_MaxPrice);
                    return res;
                }
     }
            }
    }




    function getTokenPrice() public view returns(uint256 ) //finding token's current price 
    {   //Finding total number of shares 
        uint256 TotalTokenCS = (shareStructure.ComapnySharePerBucket).mul((shareStructure.MaxBucketNumber));
        //Variable for storing Current Price 
        uint256 CurrentPrice;
        // percentage of total number of token sold
        uint256 nbTokenSoldPer = (nbTokenBidded.mul(100).div(TotalTokenCS));  
        // finds how much delta is to be added to add to intial price, to find current price
            if(nbTokenSoldPer <= 1)
            {
                CurrentPrice = tokenPriceStructure.initialPrice;
                return CurrentPrice ;
            }
           else{ 
            uint256 x = ((nbTokenSoldPer).sub(1)).div(10);  
        //  finding current price                
            CurrentPrice = (tokenPriceStructure.initialPrice).add(x.mul(tokenPriceStructure.delta));
            return CurrentPrice ;            
    }
    }


    function getSharesAllocated( ) public view returns (uint256) // finds total number of shares allocated till now
    {  // global variable which gets upadated when actual buying transaction takes place
        return SharesAllocated;
    }




 function getShares() public payable returns (uint256) // finds total number of shares held by an individual
 {
     uint256 SharesHeld =0 ;
        { 
            // storing The adderss of the entity who made the request
        address person = msg.sender;
        {
            // loop for running through out the list , to find out total shares held 
        for(uint256 i = 0 ; i <= TOwner.length-1 ; ++i)
        {
            // if address matches in list means , requesting person is owner of the perticular token           
            if (TOwner[i].owner == person)
            {
                uint256 Shares = TOwner[i].numberOftokens;
            // variable storing total number of tokens
                SharesHeld = SharesHeld + Shares ; 
                return SharesHeld;

        }
            // returning 0 if requesting entity is not owner of any token
            return 0;
}
}
    } 
 }

    function getRaisedMoneyAmount() public onlyOwner returns (uint256) // Finds total Amount raised till now ,thorugh selling of tokens
    {
        // Global variable, which get updated when actual buying transaction is done   
        return AmountRaised;
    }

    function IsRaisingMoneySuccessful() public  onlyOwner  returns (bool) //returns true/false if Raising EndPoint reached & assign tokens to winning bidders
    {    
        if(block.timestamp> EndDate)
        {   
            AssembleBids();
            bool res = buy();
        return res;
    }
    else{return false;}
    }

   // remember if task == 0 means someone has placed a new bid so it is added in  nbTokenBidded.
   // and if task == 1 , it means someone has cancelled a least profitable bid , so nbTokenBidded should be reduced
    function getTokenAmount(uint256 _tokens, uint256 task) public returns (bool)   // return total number of tokens on which bidding is done
    {  
        if (task == 0)
         {
             //adding tokens in total number of tokens on which bidding is done at placeBuyOrder 
            nbTokenBidded = nbTokenBidded + _tokens;

         }
         else if  (task == 1)
         {
             //removing tokens from total number of biidedtokens 
             nbTokenBidded = nbTokenBidded - _tokens;
         }
        return true;
    } 

    function PlaceCancelBid(address beneficiary) internal returns (bool) // Cancel only the most non-profitable bid 
    {
        uint256 IdOfCanceling ;
        uint256 isLatest = StartDate;
        uint256 isCurrent =0;
        for (uint256 i = 0 ; i < bids.length; i++)
        {
            if(bids[i].bidder == beneficiary)
            {  
                isCurrent = bids[i].timeOfBid ;
                if(isLatest < isCurrent)
                {
                    isLatest = isCurrent ;
                    IdOfCanceling = i;
                }

            }
        }

        delete bids[IdOfCanceling] ;
        getTokenAmount(bids[IdOfCanceling].nbTokens , 1);
       return true ;
        }


    function PlaceSellOrder(address beneficiary, uint256 _nbTokens, uint256 _AskingPrice) internal returns(bool)
    {   
        // Adding SellOrder in the list of all sellorder

        SellOrder memory SOrders = SellOrder(beneficiary, _nbTokens, _AskingPrice);
        SOrder.push(SOrders);
        return true ; 

    }

    function PlaceBuyOrder(address beneficiary,uint256 _nbTokens,uint256 _MaxPrice, uint256 _time ) internal returns (bool)
    { 
        //owner of the contract cannot bid 
        if(beneficiary == owner)
        {
            return false ;
        }
        else
        {// Adding bid in the list of all bids
        TokenBid memory bid = TokenBid(beneficiary, _nbTokens, _MaxPrice, _time);
        bids.push(bid);
        // calling ReAssemble funtion as new entry is made in list
        //ReAssembleBid();
        bool done = getTokenAmount(_nbTokens , 0);
        return done;
        }
    } 

    function sell(address beneficiary ,uint256 _tokensToSell,uint256 _AskingPrice)internal view  returns (bool) // Selling tokens
    { 
        address seller = beneficiary ;
        address buyer = msg.sender ;
        uint256 RecievingAmount = _AskingPrice.mul(_tokensToSell);

        // transfer RecievingAmount from buyer to seller 
        // require(Amount.transfer(seller,RecievingAmount));
        return true ;
    }    

    function buy() public returns(bool) // actual buying of tokens on the basis of priorities 
    {  

         uint256 l = bids.length-1;
        uint256 j;
        uint256 i;
        for( i = 0; i < l; i++) {
            for( j = i+1; j <= l ;j++) {
                if(bids[i].MaxPrice > bids[j].MaxPrice) {
                    uint256 temp = bids[i].MaxPrice;
                    bids[i].MaxPrice = bids[j].MaxPrice;
                    bids[j].MaxPrice = temp;
                }
            }
        }

        uint256 TotalTokenCS = shareStructure.ComapnySharePerBucket.mul(shareStructure.MaxBucketNumber);
        uint256 index = bids.length-1;
        for ( i = 0 ; i < bids.length;i++ )
        {   
            if( TotalTokenCS !=0 && bids.length > 0)
            { 

            uint256 CurrentPrice = getTokenPrice();
            address winningbidder = bids[index].bidder;
            uint256 tokentoAllocate = bids[index].nbTokens;
            uint256 Amount = CurrentPrice.mul(tokentoAllocate);

            AmountRaised = AmountRaised.add(Amount);
            SharesAllocated = SharesAllocated + tokentoAllocate;

            TotalTokenCS = TotalTokenCS.sub(tokentoAllocate);
            delete bids[index];
            --index; 

            for( j=0 ; j<TOwner.length ; j++)
            if(TOwner[j].owner == winningbidder )
            {
                uint256 total = TOwner[j].numberOftokens.add(tokentoAllocate);
                TOwner[j].numberOftokens += total ;


            }
            else{
                TokenOwner memory TOwners = TokenOwner(winningbidder, tokentoAllocate);
             TOwner.push(TOwners);
            }
        }
        }

         if( TotalTokenCS == 0 || bids.length == 0)
           { return true; }
           else
           {return false;}

        }

   // fallback function
   function () external payable { 
    revert();
}

function AssembleBids() internal   //function for filtering of bids (filters on the basis of time , profilt and legidity)
{


    for(uint256 i = 0 ; i < bids.length ; i ++)
    {
        uint256[] memory list ;
        uint256 count = 0;

        list[count]=i ;

        for(uint256 j = i+1 ; j < bids.length ; j++)
        {
            if(bids[i].bidder == bids[j].bidder)
            {
                count++;
              list[count]=j ;

            }
        }
    if(count >0)
    { uint256 PassingCount = count.div(2); 
        address beneficiary;
        while (count > PassingCount)
        {   uint256 IdOfLatest ;
            uint256 IdOfOldest ;
            uint256[] memory bidsOfBidder;
            uint256 isLatest = 0;
            uint256 isOldest = 0;
            uint256 q=0 ;
            for (uint256 p = 0 ; p < bids.length; p++)
            {
                if(bids[p].bidder == beneficiary)
                {  
                    bidsOfBidder[q] == p ;
                    q++;
                }
            }
            for (uint256 r=0 ; r< bidsOfBidder.length ; r++)
            {      //cancel latest bid

                uint256 t = bidsOfBidder[r];
                        if(isLatest< bids[t].timeOfBid)
                        {
                            isLatest=bids[t].timeOfBid;
                            IdOfLatest = t ;
                        }
                        if(isOldest > bids[t].timeOfBid)
                        {
                            isOldest=bids[t].timeOfBid;
                            IdOfOldest = t ;
                        }


            }
             uint256 CurrentPrice = getTokenPrice(); 

            if(bids[IdOfOldest].MaxPrice<CurrentPrice)
            {
            delete bids[IdOfOldest] ;
            getTokenAmount(bids[IdOfOldest].nbTokens , 1);
            }
            else
            {
                 delete bids[IdOfLatest] ;
            getTokenAmount(bids[IdOfLatest].nbTokens , 1);
            }
            count--;

                    }




                }
            }
}

}
